import React from 'react'
import { useState } from 'react'
export default function TodoForm() {
   const [input,setinput]=useState('');

   const handleDefault =e=>{
     e.preventDefault();
   }
  return (
    <div>
        <form className='todo-form' onSubmit={ handleDefault}>
          <input className='todo-input' type='text' placeholder='Add Your Todays Task' value={input} name='text'></input>
          <button>Add Todo</button>
        </form>

    </div>
       
  )
}
